import { useState } from 'react'
import profile_photo from "./../images/HL WONG.png"

export default function Profile() {

    const frequency = document.getElementsByClassName("frequency");
    let frequency_selected;
    const active = event => {
        for (let i = 0; i < frequency.length; i++) {
            /* If any of the p element className contain "active" */
            if (frequency[i].classList.contains("active")) {
                /* If any of the p element className doesn't contain "daily", "weekly", "monthly" */
                if (!frequency[i].classList.contains("daily") || !frequency[i].classList.contains("weekly") || !frequency[i].classList.contains("monthly")) {
                    frequency[i].classList.remove("active")
                    event.currentTarget.classList.add("active")

                    /* If the event className clicked that contains "daily" */
                    if (event.currentTarget.classList.contains("daily")) {
                        frequency_selected = "daily"
                    }
                    /* Else if the event className clicked that contains "weekly" */
                    else if (event.currentTarget.classList.contains("weekly")) {
                        frequency_selected = "weekly"
                    }
                    /* Else if the event className clicked that contains "monthly" */
                    else if (event.currentTarget.classList.contains("monthly")) {
                        frequency_selected = "monthly"
                    }
                }
            }
            else {
                event.currentTarget.classList.add("active")

                if (event.currentTarget.classList.contains("daily")) {
                    frequency_selected = "daily"
                }
                else if (event.currentTarget.classList.contains("weekly")) {
                    frequency_selected = "weekly"
                }
                else if (event.currentTarget.classList.contains("monthly")) {
                    frequency_selected = "monthly"
                }
            }
        }
    }

    return (
        <div className="report__container">
            <div className="report__profile">
                <img src={profile_photo} alt="" className="profile__photo"/>
                <div>
                    <p className="profile__report">Report for</p>
                    <p className="profile__name">HL Wong</p>
                </div>
            </div>
            <div className="report__frequency">
                <p className="frequency daily" onClick={active}>Daily</p>
                <p className="frequency weekly" onClick={active}>Weekly</p>
                <p className="frequency monthly" onClick={active}>Monthly</p>
            </div>
        </div>
    )
}
